import React, {Component} from 'react';
import Header from '../components/header';
import Footer from '../components/footer';


class AddProduct extends Component{
    render() {
        return(
            <div className='NewProduct'>
                <Header/>
                <Footer/>
            </div>
        );
    }
}
export default AddProduct;
